import { Header } from 'antd/es/layout/layout';
import './App.css';
import SideMenu from './components/SideMenu/dashboard';
import { Layout } from 'antd';


function App() {
  return (
    <Layout>
      <div className="App">
        <Header>Dashboard</Header>

        <SideMenu></SideMenu>


      </div>
    </Layout>
  );
}

export default App;
